oinen > Carl Axel Gottlund','Johan Olssen Honkoinen > Carl Axel Gottlund Honkoinen, Johan Olssen 1822-04-22 puuttuu suomi Erotettu Paavo Räisäisen kirjeiden yhteydestä. Honkoinen sanellut kirjeen, Räisäinen toiminut ilmeisesti kirjurina. Suomalaisen Kirjallisuuden Seuran arkiston kirjallisuuden ja kulttuurihistorian arkistoaineistot, C. A. Gottlundin arkisto, kirjekokoelma 29 Suomalaisen Kirjallisuuden Seura Suomalaisen Kirjallisuuden Seura Kuvat: Suomalaisen Kirjallisuuden Seura, arkisto; transkriptio: Suomalaisen Kirjallisuuden Seura 29:6:1 9 http://10.214.32.27/julkaisut/uploads/9_J.O.Honkoinen.xml http://10.214.32.27/julkaisut/uploads/0268_0077749_001_f.jpg http://10.214.32.27/julkaisut/uploads/0268_0077749_002_f.jpg '),(54,'SimplePagesPage',2,1,'Julkaisun käyttöohjeet','Julkaisun käyttöohjeet <p>Kokoelmassa julkaistavien kirjeiden kuvat ja transkriptiot ovat vapaasti ladattavissa ja muokattavissa lisenssill&auml; <a href=\"https://creativecommons.org/licenses/by-sa/4.0/\"><strong>CC BY-SA 4.0</strong></a>. Kommentaarien tekij&auml;noikeus: tekij&auml;t ja Suomalaisen Kirjallisuuden Seura</p>\r\n<p>Kirjeit&auml; voi selata yhten&auml; luettelona tai vastaanottajakohtaisina kokoelmina. Kirjeet on j&auml;rjestetty kirjoitusajan mukaan. Kirjeiden XML/TEI-tiedostot ovat vapaasti ladattavissa omaa k&auml;ytt&ouml;&auml; varten (oikean yl&auml;kulman painike \'Lataa TEI-tiedostot\').</p>\r\n<p>Kunkin kirjeen sivulla on vasemmalla faksimilekuvat n&auml;ytt&auml;v&auml; galleriasovellus ja sen rinnalla kuhunkin kuvaan liittyv&auml; transkriptio. Transkription puuttuessa on kyseess&auml; konsepti, jota vastaava kirje on olemassa. Kuvia voi suurentaa ja pienent&auml;&auml;, siirt&auml;&auml;, k&auml;&auml;nt&auml;&auml; ja ladata omaan k&auml;ytt&ouml;&ouml;n. Kirjeen metatiedot saa n&auml;kyviin kuvan oikealla puolella olevasta metadata-painikkeesta. Transkription yl&auml;puolella olevilla nuolipainikkeilla p&auml;&auml;see siirtym&auml;&auml;n samanaikaisesti kuvissa ja transkriptiossa eteen- tai taaksep&auml;in. Kirjeiss&auml;, joihin liittyy kommentaareja, on n&auml;kyvill&auml; \"Kommentaarit\"-painike. Kommentaarit avautuvat omaan ikkunaansa ja ne saa piilotettua painamalla painiketta uudestaan. Transkriptioissa vaaleanpunaisella taustalla n&auml;kyviin kohtiin liittyy termien selityksi&auml;. N&auml;m&auml; tulevat n&auml;kyviin ponnahdusikkunoissa, kun hiiren osoittimen vie kohdan p&auml;&auml;lle. Selitykset sek&auml; transkriptioiden merkinn&auml;t (ks. alla) saa n&auml;kyville tai piiloon transkription yl&auml;puolella olevista painikkeista. Sivun alalaidan \'edellinen\'- ja \'seuraava\'-painikkeilla voi siirty&auml; kirjeest&auml; toiseen.</p>\r\n<h4>Hakuohjeet</h4>\r\n<p>Vapaatekstihaku (yl&auml;paneelin oikeassa laidassa) kattaa kirjeiden metatiedot ja transkriptiot. Katkaisumerkki on * (t&auml;hti). T&auml;sm&auml;llisi&auml; ilmauksia voi hakea k&auml;ytt&auml;m&auml;ll&auml; lainausmerkkej&auml;. Ilman lainausmerkkej&auml; haku palauttaa tulokset, joissa esiintyy mik&auml; tahansa haetuista sanoista. AND-haun tekeminen onnistuu k&auml;ytt&auml;m&auml;ll&auml; sulkeita ja sanaa AND. Katkaisumerkki&auml; voi k&auml;ytt&auml;&auml; my&ouml;s yhdistelm&auml;hauissa. Sumeaa hakua voi k&auml;ytt&auml;&auml; kirjoittamalla haettavan termin per&auml;&auml;n merkin ~. Vaihtelun asteen voi m&auml;&auml;ritt&auml;&auml; lis&auml;&auml;m&auml;ll&auml; merkin per&auml;&auml;n numeron (esim. ~2).</p>\r\n<table style=\"font-size: 15px; width: 50%;\">\r\n<tbody>\r\n<tr>\r\n<td><em>hakutermi* </em></td>\r\n<td>hakutulos alkaa hakutermill&auml;</td>\r\n</tr>\r\n<tr>\r\n<td><em>*hakutermi </em></td>\r\n<td>hakutulos p&auml;&auml;ttyy hakutermiin</td>\r\n</tr>\r\n<tr>\r\n<td><em>*hakutermi* </em></td>\r\n<td>hakutermi esiintyy hakutuloksen keskell&auml;</td>\r\n</tr>\r\n<tr>\r\n<td><em>\"hakutermi1 hakutermi2\" </em></td>\r\n<td>hakutermit esiintyv&auml;t per&auml;kk&auml;in haetussa muodossa</td>\r\n</tr>\r\n<tr>\r\n<td><em>hakutermi1 hakutermi2 </em></td>\r\n<td>jokin hakutermeist&auml; esiintyy hakutuloksessa</td>\r\n</tr>\r\n<tr>\r\n<td><em>(hakutermi1 AND hakutermi2) </em></td>\r\n<td>kaikki hakutermit esiintyv&auml;t hakutuloksessa</td>\r\n</tr>\r\n<tr>\r\n<td><em>hakutermi~</em></td>\r\n<td>sumea haku; hakutermi sek&auml; tulokset, jotka eroavat hakutermist&auml; yhdell&auml; tai useammalla merkill&auml;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Esimerkiksi kaikki Paavo R&auml;is&auml;isen 1830-luvulla kirjoittamat kirjeet l&ouml;ytyv&auml;t haulla <em>(R&auml;is&auml;inen AND 183*)</em>. Haku&nbsp;<em>R&auml;is&auml;inen 183*</em> palauttaisi kirjeet, jotka on kirjoittanut Paavo R&auml;is&auml;inen tai jotka on kirjoitettu 1830-luvulla.</p>\r\n<p>Sumeassa haussa esimerkiksi haku <em>Gottlund~</em> palauttaa Gottlund, Gottlundi, Gottlun ja niin edelleen.</p>\r\n<p>Vapaatekstihaun hakutulossivu listaa kirjeiden otsikot, kent&auml;t joista haettavat termit l&ouml;ytyiv&auml;t sek&auml; kuvat ja TEI-tiedostot. Sivun vasemmassa laidassa n&auml;kyvill&auml; linkeill&auml; voi rajata hakutulosta. Esimerkiksi jonkin \'Kieli\'-otsakkeen alla n&auml;kyv&auml;n vaihtoehton painaminen rajaa hakutulokset kyseisell&auml; kielell&auml; kirjoitettuihin kirjeisiin. Linkkiluettelo toimii my&ouml;s tilastotietona, ja tilastotiedon voi vied&auml; taulukkoon listan yl&auml;puolella n&auml;kyv&auml;ll&auml; \'Vie taulukkoon\'-painikkeella. Hakutulosten kirjeiden TEI-tiedostot voi ladata omaan k&auml;ytt&ouml;&ouml;n oikean yl&auml;kulman \'Lataa TEI-tiedostot\'-painikkeella.</p>\r\n<p>Laajennetulla haulla voi hakea kirjeit&auml; vastaanottajan, kirjoittajan, kirjoitusajan, kielen tai identifiointitunnuksen mukaan. Oletushakutyyppi on \'sis&auml;lt&auml;&auml;\' eli ep&auml;tarkka haku. Esimerkiksi kaikki 1820-luvulla kirjoitetut kirjeet saa n&auml;kyviin valitsemalla hakukent&auml;n kirjoitusaika, hakutyypin \'sis&auml;lt&auml;&auml;\' ja kirjoittamalla hakukentt&auml;&auml;n \'182\'. +-painikkeesta voi lis&auml;t&auml; hakukentti&auml; yhdistelm&auml;hakua varten (AND-haku).</p>\r\n<h4>Transkriptioiden merkinn&auml;t</h4>\r\n<table style=\"font-size: 15px; width: 50%;\">\r\n<tbody>\r\n<tr>\r\n<td><em>Alleviivaus</em></td>\r\n<td>alleviivatut kohdat faksimiless&auml;</td>\r\n</tr>\r\n<tr>\r\n<td><em>Sininen v&auml;ri, rivin yl&auml;puolella</em></td>\r\n<td>lis&auml;tyt kohdat faksimiless&auml;</td>\r\n</tr>\r\n<tr>\r\n<td><em>Punainen v&auml;ri, yliviivaus</em></td>\r\n<td>yliviivatut kohdat faksimiless&auml;</td>\r\n</tr>\r\n<tr>\r\n<td><em>Vihre&auml; v&auml;ri</em></td>\r\n<td>ep&auml;selv&auml;t kohdat faksimiless&auml;</td>\r\n</tr>\r\n<tr>\r\n<td><em>Harmaa palkki</em></td>\r\n<td>tyhj&auml;t kohdat faksimiless&auml; tai kirjoitusta ei voi transkriboida (ei saa selv&auml;&auml;, paperi repeytynyt, taitos jne.)</td>\r\n</tr>\r\n<tr>\r\n<td><em>Vihre&auml; v&auml;ri, rivin yl&auml;puolella</em></td>\r\n<td>ep&auml;selv&auml;t lis&auml;tyt kohdat faksimiless&auml;</td>\r\n</tr>\r\n<tr>\r\n<td><em>Vihre&auml; v&auml;ri, yliviivaus</em></td>\r\n<td>ep&auml;selv&auml;t yliviivatut kohdat faksimiless&auml;</td>\r\n</tr>\r\n<tr>\r\n<td><em>Harmaa palkki, yliviivaus</em></td>\r\n<td>yliviivatut kohdat faksimiless&auml;, joita ei voi transkriboida (ei saa selv&auml;&auml;, paperi repeytynyt, taitos jne.)</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h4>Tutkijoille</h4>\r\n<p>Toivotamme tervetulleeksi tutkijat, jotka olisivat kiinnostuneita kirjoittamaan asiantuntijakommentaareja kokoelman kirjeisiin. T&auml;m&auml; edellytt&auml;&auml; k&auml;ytt&auml;j&auml;tunnuksia, jotka voi hankkia ottamalla yhteytt&auml; SKS:&auml;&auml;n. Yhteystiedot l&ouml;ytyv&auml;t kohdasta \'Palaute\'. Tutkijakirjautumisen linkki l&ouml;ytyy alapalkin oikeasta reunasta. Kirjautumisen j&auml;lkeen kunkin kirjeen sivulla tulee n&auml;kyville kommentointikaavake. Kommentaarit tulevat avoimesti luettaviksi.</p>\r\n<h4>Palaute</h4>\r\n<p>Julkaisu on keskener&auml;inen, ja olemme kiitollisia kaikesta j